class Solution(object):
    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """
        result = True
        dict = {'(': -1, ')': 1,
                '[': -2, ']': 2,
                '{': -3, '}': 3}

        left = []

        sep = list(s)

        if len(s) == 0:
            return result

        if len(sep) % 2 == 1:
            return False

        if dict[sep[0]] > 0:
            return False

        for each in sep:
            # print(left, ",", each, ",", dict[each])
            if dict[each] < 0:
                left.append(dict[each])
            else:
                if - dict[each] == left[-1]:
                    del left[-1]
                else:
                    return False

        return sum([dict[each] for each in sep]) == 0


